    /**
     * 通过抓取携程网页
     * 获取取携程的json的数据
     * @param scity 出发城市三字码
     * @param ecity 到达城市三字码
     * @param data  出发时间
     * @param searchReturnTime  
     * @param flightalltemp 
     * @return
     * @throws JSONException
     */
    public static List<FlightInfo> getCtripFlightinfo(String scity, String ecity, String date, String searchReturnTime,
            List<FlightInfo> flightalltemp) throws JSONException {
        Map<String, CarbinInfo> specilCarbinMap = new HashMap<String, CarbinInfo>();
        String Jsondata = "";
        try {
            scity = getcitycode(scity);
            ecity = getcitycode(ecity);
            Wrapper_ctrip ctrip = new Wrapper_ctrip();
            FlightSearch param = new FlightSearch();
            param.setStartAirportCode(scity);
            param.setEndAirportCode(ecity);
            param.setFromDate(date);
            Jsondata = ctrip.getHtml(param);
            //            Jsondata = "{}";
            WriteLog.write("SEARCH_ctrip", "getCtripFlightinfo:" + Jsondata);
            JSONObject jSONObject = JSONObject.fromObject(Jsondata);
            if (jSONObject.has("fis")) {

            }
            else {
                Jsondata = getctripJsonbyotherIP(scity, ecity, date);
                jSONObject = JSONObject.fromObject(Jsondata);
                if (!jSONObject.has("fis")) {
                    return flightalltemp;
                }
            }
            JSONArray jSONObjectFlight = jSONObject.getJSONArray("fis");
            JSONArray jSONObjectFlight_rpl = JSONArray.fromObject(jSONObject.getString("rpl"));
            for (int j = 0; j < jSONObjectFlight.size(); j++) {
                JSONObject jSONObjectFlight_JSONObject = (JSONObject) jSONObjectFlight.get(j);
                JSONArray JSONArray_data = jSONObjectFlight_JSONObject.getJSONArray("scs");
                String stime = jSONObjectFlight_JSONObject.getString("dt");
                String etime = jSONObjectFlight_JSONObject.getString("at");
                String Airportprice = jSONObjectFlight_JSONObject.getString("tax");
                String Fuelprice = jSONObjectFlight_JSONObject.getString("of");
                String prString = jSONObjectFlight_JSONObject.getString("pr");
                JSONObject jSONObjectFlight_JSONObject_data = (JSONObject) jSONObjectFlight_rpl.get(j);
                String flight_airline = jSONObjectFlight_JSONObject_data.getString("Flight");
                for (int i = 0, size = 1; i < size; i++) {
                    JSONObject flight_JSONObject = (JSONObject) JSONArray_data.get(i);
                    CarbinInfo lowCarbin = new CarbinInfo();
                    try {
                        JSONArray JSONObject_ics = flight_JSONObject.getJSONArray("ics");
                        JSONArray JSONObject_pis = flight_JSONObject.getJSONArray("pis");
                        JSONObject JSONObject_tgq = flight_JSONObject.getJSONObject("tgq");
                        if (JSONObject_ics.size() == 0) {
                            continue;
                        }
                        JSONObject JSONObject_baoxian_obj = new JSONObject();
                        if (JSONObject_pis.size() > 0) {
                            JSONObject_baoxian_obj = (JSONObject) JSONObject_pis.get(0);
                        }
                        String CabinRules = "";
                        try {
                            CabinRules += JSONObject_tgq.getString("edn").replace("；", "").replaceAll("%", "％") + "|";
                            CabinRules += JSONObject_tgq.getString("rfn").replace("；", "").replaceAll("%", "％") + "|";
                            CabinRules += JSONObject_tgq.getString("rrn").replace("；", "").replaceAll("%", "％") + "|";
                        }
                        catch (Exception e) {
                        }
                        //                        JSONObject JSONObject_ics_obj = (JSONObject) JSONObject_ics.get(0);
                        //                        String JSONObject_ics_IconType = JSONObject_ics_obj.getString("IconType");
                        String price = flight_JSONObject.getString("p");
                        lowCarbin.setPrice(Float.parseFloat(price));
                        if (JSONObject_baoxian_obj.has("p")) {
                            lowCarbin.setPrice(lowCarbin.getPrice() + 30);
                            lowCarbin.setSpecial(false);
                            //是惠飞保,携程强制购买保险这里票面价+30,这里系统不需要买保险所以为false
                        }
                        else {
                            lowCarbin.setSpecial(true);
                            //不是惠飞保
                        }

                        String Cabintypename = flight_JSONObject.getString("c");//"Y":"经济舱","C":"公务舱","F":"头等舱"
                        if ("Y".equals(Cabintypename)) {
                            Cabintypename = "经济舱";
                        }
                        else if ("C".equals(Cabintypename)) {
                            Cabintypename = "公务舱";
                        }
                        else if ("F".equals(Cabintypename)) {
                            Cabintypename = "头等舱";
                        }

                        //此处把准点率放到了舱位说明里面
                        lowCarbin.setCabinRemark("历史准点率:" + prString + "%");
                        String cabin = flight_JSONObject.getString("sc");
                        String discount = flight_JSONObject.getString("rate");
                        lowCarbin.setCabinRules("需要购买20元保险,票面价有可能略低,差价不退,不能废票,不提供行程单,退改签规则以供应商审核为准,请半小时内支付;"
                                + CabinRules);
                        lowCarbin.setCabintypename(Cabintypename);
                        lowCarbin.setCabin(cabin);
                        lowCarbin.setDiscount(Float.parseFloat(discount));
                        lowCarbin.setFuelprice(Float.parseFloat(Fuelprice));
                        lowCarbin.setAirportprice(Float.parseFloat(Airportprice));
                        specilCarbinMap.put(flight_airline, lowCarbin);
                    }
                    catch (Exception e) {
                        e.printStackTrace();
                    }
                }
            }
        }
        catch (Exception e) {
            System.out.println("SEARCH_ctrip:" + e.getMessage());
            WriteLog.write("SEARCH_ctrip", e.getMessage() + ":" + Jsondata);
        }

        //设置特特价数据
        for (int i = 0, size = flightalltemp.size(); i < size; i++) {
            try {
                flightalltemp.get(i).setRemark(specilCarbinMap.get(flightalltemp.get(i).getAirline()).getCabinRemark());
            }
            catch (Exception e) {
            }
            String tempAirline = flightalltemp.get(i).getAirline();
            //如果有这个航班对应的舱位并且这个舱位的价格比最低的票面价低
            if (specilCarbinMap.get(tempAirline) != null
                    && specilCarbinMap.get(tempAirline).getPrice() < flightalltemp.get(i).getLowCarbin().getPrice()) {
                CarbinInfo ctripCarbinInfo = specilCarbinMap.get(flightalltemp.get(i).getAirline());
                CarbinInfo oldCarbinInfo = flightalltemp.get(i).getLowCarbin();
                //                if (!oldCarbinInfo.getCabin().equals(ctripCarbinInfo.getCabin())) {//航班最低舱位和携程最低舱位不同
                CarbinInfo specilCarbin = specilCarbinMap.get(flightalltemp.get(i).getAirline());
                try {
                    if (flightalltemp.get(i).getYPrice() != null && flightalltemp.get(i).getYPrice() > 0) {
                        Float discount = specilCarbin.getPrice() / flightalltemp.get(i).getYPrice() * 10;
                        DecimalFormat format = (DecimalFormat) NumberFormat.getInstance();
                        format.applyPattern("###0.0");
                        try {
                            String discount_S = format.format(discount);
                            specilCarbin.setDiscount(Float.parseFloat(discount_S));
                        }
                        catch (Exception e) {
                        }
                    }
                }
                catch (Exception e) {
                    // TODO: handle exception
                }
                flightalltemp.get(i).setSpeCarbinInfo(specilCarbin);
                //                }
            }
        }

        return flightalltemp;
    }

