    public static String gethangzhanlou(String codeid) {
        String result = "--";
        try {
            Document document;
            document = DocumentHelper.parseText(HZLXMLdata);
            org.dom4j.Element root = document.getRootElement();
            org.dom4j.Element Header = root.element("Header");
            String ResultCode = Header.attributeValue("ResultCode");
            org.dom4j.Element GetAirportBuildingInfos = root.element("GetAirportBuildingInfos");
            org.dom4j.Element AirportBuildingInfosList = GetAirportBuildingInfos.element("AirportBuildingInfosList");
            List list = AirportBuildingInfosList.elements("AirportBuildingInfoEntity");
            for (int i = 0; i < list.size(); i++) {
                org.dom4j.Element ele = (Element) list.get(i);
                String id = ele.elementText("ID");
                String SMSName = ele.elementText("SMSName");
                if (id.equals(codeid)) {
                    result = SMSName;
                    break;
                }
            }
        }
        catch (DocumentException e) {
            e.printStackTrace();
        }
        return result;
    }

