    static DateFormat fromat = new SimpleDateFormat("yyyy-MM-dd");

    public static Zrate getZrateValue(String tempsc, String tempec, List<FlightInfo> flightalltemp, int i,
            CarbinInfo ctripCarbinInfo, CarbinInfo oldCarbinInfo) {
        Zrate zrate = new Zrate();
        try {
            //需要保存到数据库的携程的政策
            zrate.setAgentid(12L);
            zrate.setDepartureport(tempsc);
            zrate.setArrivalport(tempec);
            zrate.setFlightnumber(flightalltemp.get(i).getAirline());
            zrate.setCabincode(flightalltemp.get(i).getLowCarbin().getCabin());
            zrate.setCreateuser("CTRIP");
            zrate.setCreatetime(new Timestamp(System.currentTimeMillis()));
            zrate.setIsenable(1);
            zrate.setAircompanycode(flightalltemp.get(i).getAirline().substring(0, 2));
            zrate.setTickettype(2);
            zrate.setOutid("ctrip");
            zrate.setRemark((ctripCarbinInfo.getCabinRules() == null ? "" : ctripCarbinInfo.getCabinRules()));
            zrate.setWorktime("09:00");
            zrate.setAfterworktime("18:00");

            zrate.setGeneral(1L);

            zrate.setBegindate(new Timestamp(fromat.parse(
                    flightalltemp.get(i).getDepartTime().toString().substring(0, 10)).getTime()));
        }
        catch (ParseException e) {
            // TODO Auto-generated catch block
        }

        float DISTREALRATE = (oldCarbinInfo.getPrice() - ctripCarbinInfo.getPrice()) * 100 / oldCarbinInfo.getPrice();
        DecimalFormat fnum = new DecimalFormat("##0.0");
        String dd = fnum.format(DISTREALRATE);
        zrate.setRatevalue(Float.parseFloat(dd));

        return zrate;
    }

