    public static void testflghtdata(String resultXML) {
        List<FlightInfo> listFlightInfoAll = new ArrayList<FlightInfo>();
        try {
            Document document = DocumentHelper.parseText(resultXML);
            org.dom4j.Element root = document.getRootElement();
            org.dom4j.Element FlightSearchResponse = root.element("FlightSearchResponse");
            org.dom4j.Element FlightRoutes = FlightSearchResponse.element("FlightRoutes");
            org.dom4j.Element DomesticFlightRoute = FlightRoutes.element("DomesticFlightRoute");
            List list = DomesticFlightRoute.element("FlightsList").elements("DomesticFlightData");
            String tempFlight = "";
            FlightInfo flightInfo = null;
            List<CarbinInfo> listCabinAll = null;
            for (int i = 0; i < list.size(); i++) {
                org.dom4j.Element DomesticFlightData = (Element) list.get(i);
                String Flight = DomesticFlightData.elementText("Flight");
                if ("".equals(tempFlight) || !tempFlight.equals(Flight)) {//第一个航班或者新的航班
                    if (!"".equals(tempFlight) && flightInfo != null) {
                        flightInfo.setCarbins(listCabinAll);
                        listFlightInfoAll.add(flightInfo);
                    }
                    tempFlight = Flight;
                    flightInfo = new FlightInfo();
                    listCabinAll = new ArrayList<CarbinInfo>();
                    String DPortCode = DomesticFlightData.elementText("DPortCode");
                    String APortCode = DomesticFlightData.elementText("APortCode");
                    String AirlineCode = DomesticFlightData.elementText("AirlineCode");
                    String AdultTax = DomesticFlightData.elementText("AdultTax");
                    String AdultOilFee = DomesticFlightData.elementText("AdultOilFee");
                    String TakeOffTime = DomesticFlightData.elementText("TakeOffTime");
                    String ArriveTime = DomesticFlightData.elementText("ArriveTime");
                    String StandardPrice = DomesticFlightData.elementText("StandardPrice");
                    String DPortBuildingID = DomesticFlightData.elementText("DPortBuildingID");
                    String APortBuildingID = DomesticFlightData.elementText("APortBuildingID");
                    String StopTimes = DomesticFlightData.elementText("StopTimes");
                    flightInfo.setStartAirport(DPortCode);// 起飞机场
                    flightInfo.setStartAirportName("");// 起飞起场名称
                    flightInfo.setEndAirport(APortCode);// 到达机场
                    flightInfo.setEndAirportName("");// 到达机场名称
                    flightInfo.setStartAirportCity("");// 起飞起场城市名称
                    flightInfo.setAirline(Flight);// 航线
                    flightInfo.setAirCompany(AirlineCode);// 航空公司
                    flightInfo.setAirCompanyName(AirlineCode);// 航空公司名称
                    flightInfo.setAirportFee(Float.parseFloat(AdultTax));// 机场建设费
                    flightInfo.setFuelFee(Float.parseFloat(AdultOilFee));// 燃油费
                    flightInfo.setDistance("");// 里程数
                    flightInfo.setMeal(false);
                    SimpleDateFormat dateFormat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss");
                    try {
                        Date startDate = dateFormat.parse(TakeOffTime.replace('T', ' '));
                        Date arriveDate = dateFormat.parse(ArriveTime.replace('T', ' '));
                        flightInfo.setDepartTime(new Timestamp(startDate.getTime()));// 起飞时间
                        flightInfo.setArriveTime(new Timestamp(arriveDate.getTime()));// 到达时间
                    }
                    catch (ParseException e) {
                        e.printStackTrace();
                    }

                    flightInfo.setYPrice(Integer.parseInt(StandardPrice.split("[.]")[0]));// 全价价格
                    flightInfo.setIsShare(0);// 是否是共享航班
                    flightInfo.setShareFlightNumber("");// 共享航班号
                    flightInfo.setAirplaneType("");// 飞机型号
                    flightInfo.setAirplaneTypeDesc("");// 飞机型号描述
                    flightInfo.setOffPointAT(DPortBuildingID);// 出发航站楼
                    flightInfo.setBorderPointAT(APortBuildingID);// 到达航站楼
                    if (!"0".equals(StopTimes)) {
                        flightInfo.setStop(true);
                        flightInfo.setIsStopInfo(StopTimes);
                    }
                    else {
                        flightInfo.setStop(false);
                    }

                    String DisplaySubclass = DomesticFlightData.elementText("DisplaySubclass");
                    String Class = DomesticFlightData.elementText("Class");
                    String Quantity = DomesticFlightData.elementText("Quantity");
                    String Rate = DomesticFlightData.elementText("Rate");
                    String Price = DomesticFlightData.elementText("Price");
                    CarbinInfo cabin = new CarbinInfo();
                    cabin.setCabin(DisplaySubclass);
                    String cabinTypeName = "Y".equals(Class) ? "经济舱" : "C".equals(Class) ? "商务舱" : "头等舱";
                    cabin.setCabintypename(cabinTypeName);
                    if (Quantity != null && "10".equals(Quantity)) {
                        cabin.setSeatNum("9");
                    }
                    else {
                        cabin.setSeatNum(Quantity);
                    }
                    cabin.setDiscount(Float.parseFloat(Rate) * 10);

                    if (cabin.getDiscount() <= 3) {
                        cabin.setSpecial(true);
                    }
                    else {
                        cabin.setSpecial(false);
                    }
                    cabin.setPrice(Float.parseFloat(Price));
                    flightInfo.setLowCarbin(cabin);
                    listCabinAll.add(cabin);

                }
                if (tempFlight.equals(Flight)) {//同一个航班不同舱位
                    String DisplaySubclass = DomesticFlightData.elementText("DisplaySubclass");
                    String Class = DomesticFlightData.elementText("Class");
                    String Quantity = DomesticFlightData.elementText("Quantity");
                    String Rate = DomesticFlightData.elementText("Rate");
                    String Price = DomesticFlightData.elementText("Price");
                    CarbinInfo cabin = new CarbinInfo();
                    cabin.setCabin(DisplaySubclass);
                    String cabinTypeName = "Y".equals(Class) ? "经济舱" : "C".equals(Class) ? "商务舱" : "头等舱";
                    cabin.setCabintypename(cabinTypeName);
                    if (Quantity != null && "10".equals(Quantity)) {
                        cabin.setSeatNum("9");
                    }
                    else {
                        cabin.setSeatNum(Quantity);
                    }
                    cabin.setDiscount(Float.parseFloat(Rate) * 10);

                    if (cabin.getDiscount() <= 3) {
                        cabin.setSpecial(true);
                    }
                    else {
                        cabin.setSpecial(false);
                    }
                    cabin.setPrice(Float.parseFloat(Price));
                    listCabinAll.add(cabin);
                }

                System.out.println(DomesticFlightData);
            }
            flightInfo.setCarbins(listCabinAll);
            listFlightInfoAll.add(flightInfo);
            System.out.println(listFlightInfoAll);
        }
        catch (DocumentException e) {
            e.printStackTrace();
        }
    }

